import React from 'react'
import { View, Text } from 'react-native'

const ProductItem = () => {
    return (
        <View>
            <View>
                <Text>Ashutosh</Text>
            </View>
            <Text>this is product item area</Text>
        </View>
    )
}

export default ProductItem
